import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import api from '../../services/api';

export default function TutorHome() {
  const [pets, setPets] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const tutor = JSON.parse(localStorage.getItem('usuario_tutor')) || {};
    if (!tutor.token) {
      alert('Você precisa estar logado como tutor.');
      navigate('/login-tutor');
      return;
    }

    api.get(`/pets?tutor=${tutor._id}`, {
      headers: { Authorization: `Bearer ${tutor.token}` }
    })
    .then(res => setPets(res.data))
    .catch(() => alert('Erro ao buscar pets'));
  }, [navigate]);

  return (
    <div className="container mt-5">
      <h2>Home do Tutor</h2>
      <Link to="/login-tutor" className="btn btn-secondary mb-3">
        Logout
      </Link>
      <ul className="list-group">
        {pets.map(pet => (
          <li key={pet._id} className="list-group-item">
            <Link to={`/pets/${pet._id}`}>{pet.nome}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}
